import './TableHeader.css';
import Checkbox from '../common/Checkbox';
import { ReactComponent as IconVarrow   } from '../common/icons/v_arrow.svg';

const TableHeader = ({
  title
}) => {
  return (
    <tr className="table__header-item">
    <th>
      <Checkbox/>
    </th>
    <th>#</th>
    <th>Дата</th>
    <th>Статус</th>
    <th>Позиций</th>
    <th>Сумма</th>
    <th>ФИО покупателя</th>
  </tr>
  );
}

export default TableHeader;
